            "Num": "Draco Rubedo Chapter: Act I",
            "ImageTitle": "Durin",
            "Intro": "Fairy tales often end on a good note... Blessings will be offered, and curses will be broken. Make a sincere wish, and it will come true. Wield your sword with courage, and every foe shall fall.<br>In the end, \"they lived happily ever after.\"<br>But then what? Some readers can't help but ask.<br>As a character born from the pages of a story, Durin sometimes finds himself facing that very question. His story seems to have reached a happy ending in Simulanka, yet he never knows where to start when trying to explain what happened afterward. If only he had his mother's magical touch with words, perhaps then he could turn those experiences into another enchanting story of his own..."
